from typing import List
class Solution:
    def twoSum(self, numbers: List[int], target: int) -> List[int]:
        res = []
        listLen = len(numbers)
        def binSearch(l, r, tmpTarget):
            while l <= r:
                median = (l+r) // 2
            # print(median)
                if numbers[median] == tmpTarget:
                    return median
                elif numbers[median] < tmpTarget:
                    l = median + 1
                else:
                    r = median - 1
            return -1
        for left, num in enumerate(numbers):
            right = binSearch(left+1, listLen-1, target-num)
            if right != -1:
                # print(right)
                res.append(left + 1)
                res.append(right + 1)
        print(res)
        return res

